import './Inscription.css';

const Inscription = () => {
    return (
        <>
            <div id="ModalLoginForm" class="modal fade">
                <div class="modal-dialog" role="document"> 
                    <div class="modal-content"> 
                        <div class="modal-header">
                            <h1 class="modal-title">Login</h1>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Inscription;
